import styled from "styled-components";

const MainLeftNavPresenter = styled.div`
    width: 70px;
    height: 100%;

    display: flex;
    flex-direction:column;
    align-items: center;

    background-color: #1E2230;
    border-right: solid 1px #FFFFFF;
`

export default MainLeftNavPresenter;
